                <div className="form-floating gray-color" id="search-bar">
                    <input onChange={(e)=> props.handaleSearchVlue(e.target.value)} className={`${darkMode ? " spic-dark-mode" : "light"} form-control border-0`} id="floatingInputGroup1" type="search" placeholder="Search for a country..." aria-label="Search" />
                </div>
            </div>           
        </div>
    </div>
    </>
  );
}

export default SearchBar;
